El fragmento que me has proporcionado parece ser el inicio de un soneto, probablemente de un poeta romántico o modernista hispanoamericano, pero no puedo identificar con certeza al autor ni completar el poema. Lo único que puedo observar es que son cuatro versos endecasílabos con rima consonante ABBA, típica de un soneto clásico, que describe metafóricamente un flujo de agua (posiblemente como una analogía de emociones o destino) que arrasa con lo delicado (las rosas) a su paso.
